function getRevisions(){jQuery.get("/api/getRevisions",function(i){var n=$.parseJSON(i);for(revision in n)console.log(n[revision]),$("#lvc-revisions-container").html("<p>"+n[revision].content+"</p>")})}var self=this;$(document).ready(function(){"revisions"==window.location.pathname.substring(1,10)&&getRevisions()});
